import React from "react";
import { Link } from "react-router-dom";

export default function TeamComp({ teams }) {
  console.log(teams);

  return (
    <>
      <h3>Teams List</h3>
      <div className="team-list">
        {teams.map((team, i) => {
          console.log(team.division === "Central");

          return (
            <div className="team-list_wrap" key={i}>
              <Link to={`/teams/${team.abbreviation}`}>
                <p>{team.full_name}</p>
              </Link>
            </div>
          );
        })}
      </div>
    </>
  );
}
